import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import ProductScreen from './screens/HomeScreen';
import HomeScreen from './screens/ProductScreen';


function App() {
  return (
    <BrowserRouter>
        <div className="grid-container">
            <header className="row">
                <div>
                    <a href="/" className="brand"> <img src="https://img.icons8.com/ios-filled/50/000000/checkout.png"/> Easy Way </a>
                </div>

                <div className="Cart-signin-padding">
                    <a href="/Cart" >Cart</a>
                    <a href="/Signin" >Sign In</a>
                </div>
            </header>

            <main>
                <Route path="/product/:_id" component={ProductScreen} ></Route>
                <Route path="/" component={HomeScreen} exact ></Route>
            </main>

            <footer className="row center">
                <div>All right reserved</div>
            </footer>
        </div>
    </BrowserRouter>
  );
}

export default App;
